import styled from "styled-components";
// import {NavLink} from 'react-router-dom';

function Category() {
  return (
    <div>
        <div>
            <h4>Pescetarian</h4>
        </div>
        <div>
            <h4>Lacto Vegetarian</h4>
        </div>
        <div>
            <h4>Ovo vegetarian</h4>
        </div>
        <div>
            <h4>Vegan</h4>
        </div>
        <div>
            <h4>Vegetarian</h4>
        </div>
    </div>
  )
}


const List = styled.div`
display: flex;
justify-content: cebter;
margin: 2rem 0rem;

`

export default Category
